import React , { useState , createContext} from 'react'


const val = createContext()
const MyContecest = ({children}) => {

    const {data , setData} = useState('red');

    const ChangeData = (e) => {
        setData(e)
    }

  return (
    <val.Provider value={{data , ChangeData}}>
        {children}
    </val.Provider>
  )
}

export {MyContecest , val}
